const InstallMetamask = () => {

  return (
    <div className="navigation__wallet">
      <a  href={"https://metamask.io/download.html"}>
        <p className="navigation__wallet__status">Install Metamask</p>
      </a>
    </div>
  );
}

export default InstallMetamask;
